INSERT INTO `mail` VALUES (1,1,1,'registration','','Gebruikers','Nieuwe gebruiker (via registratie)','Bezoeker heeft zich geregistreerd via de website.','Uw registratie bij {{sitename}}.','<p>U heeft zich succesvol geregistreerd op {{sitename}}.</p>\r\n\r\n<p>Hieronder vind u uw nieuwe wachtwoord om mee in te loggen:</p>\r\n\r\n<table>\r\n	<tbody>\r\n		<tr>\r\n			<td style=\"padding-right:20px;\">Gebruikersnaam:</td>\r\n			<td style=\"font-weight:bold;\">{{username}}</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"padding-right:20px;\">Wachtwoord:</td>\r\n			<td style=\"font-weight:bold;\">{{password}}</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n\r\n<p><a href=\"https://neutraleco.beyonitdev.nl/mijn-account/\">U kunt inloggen door op deze link te klikken</a></p>'),(2,1,1,'registration_pending','','Gebruikers','Nieuwe gebruiker (via registratie, wachten op validatie)','Bezoeker heeft zich geregistreerd via de website en wacht op validatie.','Uw registratie bij {{sitename}}.','<p>U heeft zich succesvol geregistreerd op {{sitename}}.</p>\n\n\n\n<p>Hieronder vind u alvast uw nieuwe wachtwoord om mee in te loggen:</p>\n\n\n\n<table>\n\n	<tbody>\n\n		<tr>\n\n			<td style=\"padding-right:20px;\">Gebruikersnaam:</td>\n\n			<td style=\"font-weight:bold;\">{{username}}</td>\n\n		</tr>\n\n		<tr>\n\n			<td style=\"padding-right:20px;\">Wachtwoord:</td>\n\n			<td style=\"font-weight:bold;\">{{password}}</td>\n\n		</tr>\n\n	</tbody>\n\n</table>\n\n<p><strong>LET OP:</strong><br/>Uw nieuwe account is nog niet actief, wij controleren uw aanmelding zo snel mogelijk, en u ontvangt een e-mail zodra uw account actief is.</p>\n\n'),(3,1,1,'registration_notify','','Gebruikers','Nieuwe gebruiker (beheerder melding)','Melding voor de beheerder bij een nieuwe registratie.','Er is een nieuwe registratie op {{sitename}}.','<p>Geachte beheerder,</p>\n\n\n\n<p>Een bezoeker heeft zich geregistreerd op de website, en wacht tot zijn/haar account wordt gemodereerd.<br />\n\nHieronder vind u enkele gegevens dit door deze bezoeker zijn ingevuld:</p>\n\n\n\n<table>\n\n	<tbody>\n\n		<tr>\n\n			<td style=\"padding-right:20px;\">Gebruikersnaam:</td>\n\n			<td><strong>{{email}}</strong></td>\n\n		</tr>\n\n		<tr>\n\n			<td style=\"padding-right:20px;\">Voornaam:</td>\n\n			<td><strong>{{firstname}}</strong></td>\n\n		</tr>\n\n		<tr>\n\n			<td style=\"padding-right:20px;\">Achternaam:</td>\n\n			<td><strong>{{lastname}}</strong></td>\n\n		</tr>\n\n		<tr>\n\n			<td style=\"padding-right:20px;\">Straat:</td>\n\n			<td><strong>{{street}}</strong></td>\n\n		</tr>\n\n		<tr>\n\n			<td style=\"padding-right:20px;\">Huisnummer:</td>\n\n			<td><strong>{{number}}</strong></td>\n\n		</tr>\n\n		<tr>\n\n			<td style=\"padding-right:20px;\">Postcode:</td>\n\n			<td><strong>{{postalcode}}</strong></td>\n\n		</tr>\n\n		<tr>\n\n			<td style=\"padding-right:20px;\">Plaats:</td>\n\n			<td><strong>{{city}}</strong></td>\n\n		</tr>\n\n		<tr>\n\n			<td style=\"padding-right:20px;\">Telefoonnummer:</td>\n\n			<td><strong>{{phone}}</strong></td>\n\n		</tr>\n\n	</tbody>\n\n</table>\n\n\n\n<p>U kunt dit account autoriseren via het website beheer.</p>'),(4,1,1,'registration_enabled','','Gebruikers','Gebruiker is geactiveerd','De niet gemodereerde gebruiker is zojuist geactiveerd.','Uw account op {{sitename}} is geactiveerd.','Uw account op {{sitename}} is geactiveerd.'),(5,1,1,'lostpassword','','Gebruikers','Wachtwoord vergeten','Gebruiker vraagt een nieuw wachtwoord aan via het wachtwoord vergeten formulier.','Je nieuwe wachtwoord voor {{sitename}}.','<p>Je hebt op onze website {{sitename}} een nieuw wachtwoord aangevraagd.</p>\r\n\r\n<p>Hieronder vind je je nieuwe wachtwoord:<br />\r\n<strong>{{newpassword}}</strong></p>'),(6,1,1,'add_project','','Gebruikers','Nieuw project toegevoegd','','Nieuw project toegevoegd','<p>Geachte websitebeheerder,</p>\n\n<p>Gebruiker&nbsp;<strong>{{username}}</strong>&nbsp;heeft een project toegevoegd op de website, en wacht tot zijn/haar project wordt gemodereerd.<br />\nHieronder vind u enkele gegevens die&nbsp;door deze gebruiker zijn ingevuld:</p>\n\n<table>\n	<tbody>\n		<tr>\n			<td>Projectnaam:</td>\n			<td><strong>{{project_name}}</strong></td>\n		</tr>\n		<tr>\n			<td>Type project:</td>\n			<td><strong>{{project_type}}</strong></td>\n		</tr>\n		<tr>\n			<td>Type project anders:</td>\n			<td><strong>{{project_type_different}}</strong></td>\n		</tr>\n		<tr>\n			<td>Projectsamenvatting:</td>\n			<td><strong>{{project_summary}}</strong></td>\n		</tr>\n		<tr>\n			<td>Projectomschrijving:</td>\n			<td><strong>{{project_description}}</strong></td>\n		</tr>\n		<tr>\n			<td>Beschrijving project/bedrijf beheerder:</td>\n			<td><strong>{{project_company_desciption}}</strong></td>\n		</tr>\n		<tr>\n			<td>Certificeringsorgaan:</td>\n			<td><strong>{{project_certificates}}</strong></td>\n		</tr>\n		<tr>\n			<td>Start projectdatum:</td>\n			<td><strong>{{project_date_start}}</strong></td>\n		</tr>\n		<tr>\n			<td>Eind projectdatum</td>\n			<td><strong>{{project_date_end}}</strong></td>\n		</tr>\n		<tr>\n			<td>Locatie</td>\n			<td><strong>{{project_location}}</strong></td>\n		</tr>\n		<tr>\n			<td>Aantal CO2-credits</td>\n			<td><strong>{{project_qty_co2_credits}}</strong></td>\n		</tr>\n		<tr>\n			<td>Prijs per credit</td>\n			<td><strong>{{project_price_per_credit}}</strong></td>\n		</tr>\n	</tbody>\n</table>\n\n<p>tekst na de project waarden.</p>'),(7,1,1,'add_project_next_steps','','Gebruikers','Nieuw project vervolgstappen','','Nieuw project vervolgstappen','<p>Geachte <strong>{{username}}</strong>,</p>\r\n\r\n<p>Je hebt zojuist een project toegevoegd op de website.<br />\r\nHieronder vind je de vervolgstappen</p>\r\n\r\n<ol>\r\n	<li>Eerste stap</li>\r\n	<li>Tweede stap</li>\r\n	<li>Derde stap</li>\r\n</ol>\r\n\r\n<p>tekst na de vervolgstappen.</p>'),(8,1,1,'add_project_comment','','Gebruikers','Reactie op project','','Reactie op project','<p>Geachte <strong>{{full_name_receiver}}</strong>,</p>\r\n\r\n<p>Volgende reactie is toegevoegd door {{full_name_sender}} op project \'{{project_name}}\'<br />\r\n<br />\r\n{{content}}</p>'),(9,1,1,'add_project_transaction','','Gebruikers','Project transactie toevoegen','','Project transactie toevoegen','<p>Geachte <strong>{{full_name_sender}}</strong>,</p>\r\n\r\n<p>Gefeliciteerd! Uw credits van {{credits}} is toegevoegd op project \'{{project_name}}\'</p>'),(10,1,1,'approve_project','','Gebruikers','Project goedkeuren','','Project goedkeuren','<p>Geachte <strong>{{full_name_receiver}}</strong>,</p>\r\n\r\n<p>Gefeliciteerd! Uw&nbsp;project \'{{project_name}}\' is goedgekeurd.</p>\r\n\r\n<p><a href=\"{{project_link}}\">Klik hier om het project te bekijken.</a></p>'),(11,1,1,'decline_project','','Gebruikers','Project afgekeurd','','Project afgekeurd','<p>Geachte <strong>{{full_name_receiver}}</strong>,</p>\n\n<p>Helaas is uw&nbsp;project \'{{project_name}}\' afgekeurd.<br />\n<br />\nNeem contact met ons op als hier vragen over zijn.</p>'),(12,1,1,'save_account_info','','Gebruikers','Mijn gegevens opslaan','','Account gegevens volledig aangevuld','<p>Geachte <strong>{{full_name_receiver}}</strong>,</p>\r\n\r\n<p>Gefeliciteerd! Uw account is volledig aangevuld met benodigde gegevens en kunt nu projecten toevoegen.<br />\r\n<br />\r\n<p><a target=\"_blank\" href=\"https://neutraleco.beyonitdev.nl/mijn-account/projecten/aanmelden\">Klik hier om een nieuw project toe te voegen</a></p>\r\n<br />\r\nNeem contact met ons op als hier vragen over zijn.</p>'),(13,1,1,'add_project_transaction_project_owner','','Gebruikers','Project transactie toegevoegd (voor projecteigenaar)','','Project transactie toegevoegd','<p>Project&nbsp;\'{{project_name}}\' heeft met succes een transactie ontvangen met de volgende gegevens:</p>\r\n\r\n<p>Naam:&nbsp;{{full_name_receiver}}<br />\r\nBedrijfsnaam:&nbsp;{{full_name_receiver}}<br />\r\nE-mailadres: {{email}}<br />\r\nCredits: {{credits}}</p>'),(14,1,1,'approved_project','','Gebruikers','Project aanpassingen goedkeuren','','Project aanpassingen goedkeuren','<p>Geachte <strong>{{full_name_receiver}}</strong>,</p>\r\n\r\n<p>De aanpassingen op uw&nbsp;project \'{{project_name}}\' zijn&nbsp;goedgekeurd.</p>\r\n\r\n<p><a href=\"{{project_link}}\">Klik hier om het project te bekijken.</a></p>');
