:1:\"4\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";s:5:\"title\";s:26:\"Betrouwbaar en transparant\";s:7:\"content\";s:70:\"<p>Hierdoor garanderen we 100% betrouwbaarheid en transparantie.</p>\r\n\";}',0,''),(7,4,4,'1f0o7drnsg','block-0',0,'4,/uploads/images/20220825/6915_pexels-akil-mazumder-1072824.jpg,pexels-akil-mazumder-1072824.jpg','[]',NULL,NULL,NULL,'text','a:9:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"4\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";s:5:\"title\";s:33:\"Positieve impact door CO2-credits\";s:7:\"content\";s:86:\"<p>Neutral levert een positieve bijdrage aan het omkeren van klimaatverandering.</p>\r\n\";}',0,''),(8,5,NULL,'81lj5ugvkh','block-0',0,NULL,'[]',NULL,NULL,NULL,NULL,'a:9:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";s:5:\"title\";s:37:\"Bemiddeling bij lokale carbon credits\";s:4:\"text\";s:838:\"<p>Wil je je CO2-uitstoot verminderen of compenseren en tegelijkertijd de lokale economie en het milieu steunen? Dan zijn lokale carbon credits iets voor jou. Dit zijn certificaten die aangeven dat een bepaalde hoeveelheid CO2 uit de atomsfeer is gereduceerd door een duurzaam project in jouw regio. </p>\r\n\r\n<p>Wij bieden je een stukje dienstverlening waardoor de handel in de carbon credits transparanter wordt. Je kunt via ons in contact komen met de aanbieders en afnemers van deze certificaten. </p>\r\n\r\n<p>Kies uit verschillende projecten die bij jouw wensen en doelen passen. Je kunt ook zien hoeveel CO2-reductie je hiermee bereikt en wat de impact is op de lokale gemeenschap en het klimaat.</p>\r\n\r\n<p>Met Neutral kun je dus niet alleen je CO2-voetafdruk verkleinen, maar ook een positieve bijdrage leveren aan je omgeving.</p>\r\n\";}',0,''),(9,5,5,'fzx9gn14iz','block-1',1,'5,/uploads/images/20220825/6517_pexels-pixabay-414807.jpg,pexels-pixabay-414807.jpg','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"7\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(10,6,4,'bzwsr84jnz','block-1',0,'4,/uploads/images/20220825/6915_pexels-akil-mazumder-1072824.jpg,pexels-akil-mazumder-1072824.jpg','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"7\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(11,6,NULL,'18zgegj402','block-0',1,NULL,'[]',NULL,NULL,NULL,NULL,'a:9:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";s:5:\"title\";s:31:\"100% betrouwbaar en transparant\";s:4:\"text\";s:759:\"<p>Hoe weet je zeker dat de carbon credits die je koopt of verkoopt echt zijn en dat ze niet dubbel worden gebruikt of vervalst? Dat is een belangrijke vraag, want er is veel fraude en misleiding in de markt voor carbon credits. Daarom maken wij gebruik van blockchain technologie om de handel in carbon credits 100% betrouwbaar te maken. Blockchain is een onveranderlijke en gedecentraliseerde database, waarin alle transacties en informatie over de carbon credits zichtbaar en controleerbaar zijn voor iedereen in het netwerk. Zo kun je precies zien waar je carbon credits vandaan komen, wie ze heeft gekocht of verkocht en wat het effect is op de CO2-reductie. Met Neutral kun je dus vertrouwen op de kwaliteit en integriteit van je carbon credits. </p>\r\n\";}',0,''),(13,8,NULL,'52wgr7vzh9','block-0',0,NULL,'[]',NULL,NULL,NULL,NULL,'a:10:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:2:\"12\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";s:4:\"text\";s:82:\"<p>Neutral is de oplossing voor betrouwbare en transparante CO2-certificaten</p>\r\n\";s:7:\"subtext\";s:59:\"<p>Wij vertellen je graag meer over de mogelijkheden.</p>\r\n\";s:7:\"buttons\";a:1:{s:10:\"ut0sqopn0l\";a:4:{s:5:\"label\";s:15:\"Neem contact op\";s:3:\"url\";s:7:\"page:20\";s:5:\"class\";s:0:\"\";s:6:\"target\";s:0:\"\";}}}',0,''),(14,9,NULL,'qu4btergyf','block-0',0,'<h2>Neutral kiest lokaal</h2>\r\n\r\n<p>Wij geloven dat de beste manier om klimaatverandering om te keren is door lokaal te handelen. Daarom kiezen wij voor carbon credits die afkomstig zijn van duurzame projecten in jouw regio. Zo steun je niet alleen het milieu, maar ook de lokale economie en de sociale cohesie. </p>\r\n\r\n<p>Met Neutral kun je dus niet alleen je CO2-voetafdruk verkleinen, maar ook een positieve impact hebben op je omgeving.</p>\r\n','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(15,9,5,'bq60629u3h','block-0',1,'5,/uploads/images/20220825/6517_pexels-pixabay-414807.jpg,pexels-pixabay-414807.jpg','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:1:\"1\";s:2:\"id\";s:0:\"\";}',0,''),(16,10,7,'g5eiegj3at','block-0',0,'7,/uploads/images/20220826/2622_shutterstock-1793591332.jpeg,shutterstock-1793591332.jpeg','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(17,10,NULL,'5gqcaepzwn','block-0',1,'<h2>Een positieve bijdrage aan het omkeren van klimaatverandering</h2>\r\n\r\n<p>Klimaatverandering is een van de grootste uitdagingen van onze tijd. De uitstoot van broeikasgassen leidt tot een stijging van de temperatuur op aarde, met grote gevolgen voor mens, natuur en milieu. Maar er is nog hoop. Door onze CO2-uitstoot te verminderen of te compenseren met carbon credits kunnen we de opwarming van de aarde beperken of zelfs omkeren. Met Neutral kun je carbon credits kopen of verkopen die 100% transparant en betrouwbaar zijn. Zo draag je bij aan een duurzamere en betere wereld.</p>\r\n','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:1:\"1\";s:2:\"id\";s:0:\"\";}',0,''),(18,11,NULL,'jq4bziiq05','block-0',0,'<h3 style=\"text-align: center;\">Wil je meer te weten komen over onze toepassing of projecten?</h3>\r\n','[]',NULL,NULL,NULL,'text','a:8:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:2:\"12\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";s:7:\"buttons\";a:1:{s:10:\"zkaqf34o3o\";a:4:{s:5:\"label\";s:15:\"Neem contact op\";s:3:\"url\";s:7:\"page:20\";s:5:\"class\";s:0:\"\";s:6:\"target\";s:0:\"\";}}}',0,''),(19,12,NULL,'jfh7sowh7i','block-0',0,NULL,'[]',NULL,NULL,NULL,NULL,'a:10:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:2:\"12\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";s:5:\"title\";s:32:\"Blockchain-based carbon tracking\";s:7:\"content\";s:233:\"<p>Bij carbon removal, oftewel koolstofverwijdering, wordt CO2 uit de atmosfeer gehaald en voor langere periode opgeslagen in planten, (verzilte) bodems, oceanen, rotsen, uitgeputte oliebronnen, maar ook producten als cement. </p>\r\n\";s:5:\"video\";s:39:\"/neutraleco/video/banner-neutraleco.mp4\";}',0,''),(20,12,NULL,'wlycca5sts','block-1',1,NULL,'[]',NULL,NULL,NULL,NULL,'a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:2:\"12\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(21,13,NULL,'u0zauarggy','block-0',0,'<h1>Formulieren</h1>','[]','TrinityFormsBundle','Formulieren','{\"bundlename\":\"TrinityFormsBundle\",\"formlabel\":\"Contact\",\"id\":\"1\",\"redirect\":\"\"}','bundle','a:7:{s: