,'a:9:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";s:5:\"title\";s:0:\"\";s:4:\"text\";s:0:\"\";}',0,''),(71,46,NULL,'whgucjlan1','block-1',1,NULL,'[]',NULL,NULL,NULL,NULL,'a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"7\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(72,47,NULL,'14pc57k3il','block-0',0,NULL,'[]',NULL,NULL,NULL,NULL,'a:10:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:2:\"12\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";s:5:\"title\";s:31:\"Blockchain-based carbon removal\";s:7:\"content\";s:233:\"<p>Bij carbon removal, oftewel koolstofverwijdering, wordt CO2 uit de atmosfeer gehaald en voor langere periode opgeslagen in planten, (verzilte) bodems, oceanen, rotsen, uitgeputte oliebronnen, maar ook producten als cement. </p>\r\n\";s:5:\"video\";s:39:\"/neutraleco/video/banner-neutraleco.mp4\";}',0,''),(73,47,NULL,'b2kleg1lqp','block-1',1,NULL,'[]',NULL,NULL,NULL,NULL,'a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:2:\"12\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(74,48,NULL,'i5zli6u77t','block-0',0,'<h2>Impact door betrouwbare CO2 compensatie</h2>\r\n\r\n<p>Wil je een positieve bijdrage leveren aan het omkeren van klimaatverandering? Dan is het belangrijk om je CO2 uitstoot zo veel mogelijk te verminderen. Echter is het In de praktijk vaak niet mogelijk om als individu of bedrijf compleet CO2 neutraal te handelen. Om dit doel toch te bereiken dan kan je de resterende CO2 uitstoot compenseren door middel van CO2-credits. Maar hoe doe je dat op een betrouwbare en transparante manier? En hoe weet je dat de CO2 uitstoot daadwerkelijk is gecompenseerd? Daarvoor heb je Neutral nodig. Wij zijn de enige partij in Nederland die gebruik maakt van blockchain technologie om de handel in CO2-credits transparant en betrouwbaar te maken. </p>\r\n','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(75,48,5,'9l2ayvupa7','block-0',1,'5,/uploads/images/20220825/6517_pexels-pixabay-414807.jpg,pexels-pixabay-414807.jpg','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:1:\"1\";s:2:\"id\";s:0:\"\";}',0,''),(76,49,7,'vj82snp2rs','block-0',0,'7,/uploads/images/20220826/2622_shutterstock-1793591332.jpeg,shutterstock-1793591332.jpeg','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(77,49,NULL,'y5sbwuwj3y','block-0',1,'<h2>Wat zijn vrijwillige CO2-credits?</h2>\r\n\r\n<p>CO2-credits zijn certificaten die aangeven dat een bepaalde hoeveelheid CO2 is verminderd door middel van een project of activiteit die CO2 uit de atmosfeer verwijdert en opslaat in de bodem of bouwmaterialen.  Door gebruik te maken van CO2-credits kun je je eigen CO2-uitstoot verminderen of compenseren. Je kunt ze aanschaffen om je eigen uitstoot te compenseren of om te voldoen aan de vereisten van de overheid, klanten of andere belanghebbenden.</p>\r\n','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:1:\"1\";s:2:\"id\";s:0:\"\";}',0,''),(78,50,NULL,'pknwvvsm9d','block-0',0,'<h1>Formulieren</h1>','[]','TrinityFormsBundle','Formulieren','{\"bundlename\":\"TrinityFormsBundle\",\"formlabel\":\"Contact\",\"id\":\"1\",\"redirect\":\"\"}','bundle','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\