:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(84,53,NULL,'ryd06jlkjh','block-0',1,'<h2>Ons verhaal</h2>\r\n\r\n<p>Bijna dagelijks merken we de gevolgen van klimaatverandering: toenemende droogte, afgewisseld met extreme wateroverlast. Oorzaak van deze klimaatverandering is de alsmaar toenemende uitstoot van broeikasgassen. Neutral vindt dat het anders kan. Anders moet.</p>\r\n','[]',NULL,NULL,NULL,'text','a:8:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:1:\"1\";s:2:\"id\";s:0:\"\";s:7:\"buttons\";a:1:{s:10:\"979933q9pr\";a:4:{s:5:\"label\";s:9:\"Lees meer\";s:3:\"url\";s:21:\"/over-ons/ons-verhaal\";s:5:\"class\";s:0:\"\";s:6:\"target\";s:0:\"\";}}}',0,''),(85,54,NULL,'c7q4w5npke','block-0',0,'<h2>Ons team</h2>\r\n\r\n<p>Onze passie voor technologie en duurzaamheid heeft ons bij elkaar gebracht en heeft geleid tot de oprichting van ons bedrijf, dat zich richt op het bieden van transparante en betrouwbare oplossingen voor de handel in CO2-credits.&nbsp;Onze visie gaat verder dan alleen het aanbieden van een betrouwbare handelsoplossing voor CO2-credits.</p>\r\n','[]',NULL,NULL,NULL,'text','a:8:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";s:7:\"buttons\";a:1:{s:10:\"sul4sw75kn\";a:4:{s:5:\"label\";s:8:\"Ons team\";s:3:\"url\";s:14:\"/over-ons/team\";s:5:\"class\";s:0:\"\";s:6:\"target\";s:0:\"\";}}}',0,''),(86,54,5,'ddqs503rou','block-0',1,'5,/uploads/images/20220825/6517_pexels-pixabay-414807.jpg,pexels-pixabay-414807.jpg','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:1:\"1\";s:2:\"id\";s:0:\"\";}',0,''),(87,55,NULL,'66883wuvmw','block-0',0,'<h1>Nieuws</h1>','[]','TrinityBlogBundle','Nieuws','{\"bundlename\":\"TrinityBlogBundle\",\"type\":\"