en van lokaal geproduceerde vrijwillige CO2 credits met behulp van blockchain technologie. Wij geloven dat een duurzamere en betere wereld mogelijk is als we samenwerken en transparant zijn over onze CO2 uitstoot en reductie. Daarom bieden wij een unieke oplossing die meerwaarde creëert voor onze aanbieders, afnemers en partners. Ontdek hieronder waarom Neutral de beste keuze is voor jou.</p>\r\n','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(94,59,5,'0zls0kwy5i','block-0',1,'5,/uploads/images/20220825/6517_pexels-pixabay-414807.jpg,pexels-pixabay-414807.jpg','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:1:\"1\";s:2:\"id\";s:0:\"\";}',0,''),(95,60,7,'0b6j9dw09h','block-0',0,'7,/uploads/images/20220826/2622_shutterstock-1793591332.jpeg,shutterstock-1793591332.jpeg','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(96,60,NULL,'o90ym90opj','block-0',1,'<h2>Blockchain based carbon credits: 100% transparant en betrouwbaar</h2>\r\n\r\n<p>Neutral is de enige partij in Nederland die gebruik maakt van blockchain technologie voor het verhandelen van carbon credits. Dit betekent dat elke transactie onveranderlijk wordt vastgelegd in een digitaal grootboek dat voor iedereen toegankelijk is. Zo kun je altijd zien waar je carbon credits vandaan komen, wie ze heeft geproduceerd en hoeveel CO2-reductie ze opleveren. Je kunt er dus zeker van zijn dat je carbon credits echt zijn en niet dubbel worden verkocht. Fraude met deze certificaten is dan ook uitgesloten.</p>\r\n','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:1:\"1\";s:2:\"id\";s:0:\"\";}',0,''),(97,61,NULL,'rs1yza0oq3','block-0',0,'<p>Bijna dagelijks merken we de gevolgen van klimaatverandering: toenemende droogte, afgewisseld met extreme wateroverlast. Oorzaak van deze klimaatverandering is de alsmaar toenemende uitstoot van broeikasgassen. Neutral vindt dat het anders kan. Anders moet. Wij willen klimaatverandering omkeren door samen met onze aanbieders, afnemers en partners bij te dragen aan een duurzamere en betere wereld. Een wereld die meer in balans is. Dit willen we realiseren met het toepassen van blockchain technologie bij het verhandelen van lokaal geproduceerde vrijwillige CO2 credits. Alleen een volledig betrouwbare en transparante markt voor carbon credits maakt het voor bedrijven, overheden en consumenten aantrekkelijk(er) en interessant(er) om bij te dragen aan duurzame(re) businessmodellen die een belangrijke bijdrage leveren aan de reductie van broeikasgassen.</p>\r\n','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(98,61,5,'xczwcdguwx','block-0',1,'5,/uploads/images/20220825/6517_pexels-pixabay-414807.jpg,pexels-pixabay-414807.jpg','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:1:\"1\";s:2:\"id\";s:0:\"\";}',0,''),(99,62,NULL,'iso8k51g0z','block-0',0,'<h2>Waarom Neutral?</h2>\r\n\r\n<p>Neutral is de enige partij in Nederland die gebruik maakt van blockchain technologie om de handel in CO2-credits transparant en betrouwbaar te maken. Blockchain is een database, waarin transacties opgeslagen worden in een onveranderlijke en gedecentraliseerde ketting. Dit betekent dat alle informatie over de CO2-credits zichtbaar en controleerbaar is voor iedereen in het netwerk. Zo kun je precies zien waar je credits vandaan komen, wie ze heeft gekocht of verkocht en wat het effect is op de CO2-reductie.</p>\r\n\r\n<p>Met Neutral kun je dus vertrouwen op de kwaliteit en integriteit van je CO2-credits. Bovendien kun je kiezen uit verschillende projecten die lokaal geproduceerde CO2-credits aanbieden. Zo steun je niet alleen het milieu, maar ook de lokale economie en het sociale welzijn in je regio. Neutral is dé beste keuze voor gecertificeerde CO2-reductie.</p>\r\n','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(100,62,5,'7zmlsk4z2o','block-0',1,'5,/uploads/images/20220825/6517_pexels-pixabay-414807.jpg,pexels-pixabay-414807.jpg','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:1:\"1\";s:2:\"id\";s:0:\"\";}',0,''),(101,63,NULL,'sliqfirr4w','block-0',0,'<h2>Lokaal geproduceerde vrijwillige CO2 credits: directe impact en verbinding</h2>\r\n\r\n<p>Neutral werkt samen met lokale aanbieders van carbon credits, zoals boeren, bosbeheerders en energieproducenten. Zij leveren vrijwillige CO2 credits die voortkomen uit duurzame projecten die verder gaan dan de wettelijke verplichtingen. Door deze carbon credits te kopen, steun je direct deze projecten en draag je bij aan de reductie van broeikasgassen in jouw regio. Bovendien creëer je een verbinding met de aanbieders en kun je zien wat het effect is van jouw bijdrage op hun activiteiten en leefomgeving.</p>\r\n','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"5\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(102,63,5,'35jqvozkuq','block-0',1,'5,/uploads/images/20220825/6517_pexels-pixabay-414807.jpg,pexels-pixabay-414807.jpg','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:1:\"1\";s:2:\"id\";s:0:\"\";}',0,''),(103,64,NULL,'m2ibm6cvnq','block-0',0,'<h1>Formulieren</h1>','[]','TrinityFormsBundle','Formulieren','{\"bundlename\":\"TrinityFormsBundle\",\"formlabel\":\"Contact\",\"id\":\"1\",\"redirect\":\"\"}','bundle','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:1:\"0\";s:2:\"id\";s:0:\"\";}',0,''),(105,66,NULL,'gzmqj2ozhz','block-0',0,'<h1>Nieuws</h1>','[]','TrinityBlogBundle','Nieuws','{\"bundlename\":\"TrinityBlogBundle\",\"type\":\"\",\"id\":\"1\",\"limit\":\"24\",\"uri_overview\":\"/over-ons/nieuws/detail\",\"uri\":\"/over-ons/nieuws/detail\",\"category_id\":[\"1\"],\"is_overview\":\"1\"}','bundle','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:2:\"12\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(107,68,NULL,'p829bg3q02','block-0',0,NULL,'[]',NULL,NULL,NULL,NULL,'a:9:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";s:5:\"title\";s:0:\"\";s:4:\"text\";s:423:\"<p>Wij zijn een dynamisch team van jonge, duurzame ondernemers met de gezamenlijke missie om de verduurzaming van onze wereld te versnellen en uiteindelijk klimaatverandering om te keren. Onze passie voor technologie en duurzaamheid heeft ons bij elkaar gebracht en heeft geleid tot de oprichting van ons bedrijf, dat zich richt op het bieden van transparante en betrouwbare oplossingen voor de handel in CO2-credits.</p>\r\n\";}',0,''),(108,68,NULL,'z7d6xpk780','block-1',1,NULL,'[]',NULL,NULL,NULL,NULL,'a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(109,69,NULL,'xqikhf6yn7','block-1',0,NULL,'[]',NULL,NULL,NULL,NULL,'a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(110,69,NULL,'f71nyuvnqa','block-0',1,NULL,'[]',NULL,NULL,NULL,NULL,'a:9:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"6\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";s:5:\"title\";s:0:\"\";s:4:\"text\";s:490:\"<p>De oprichters&nbsp;hebben elk hun eigen unieke achtergronden en expertise op het gebied van duurzaamheid, technologie en ondernemerschap. Deze kennis en ervaring hebben zij gebundeld om onze innovatieve blockchain-oplossing te ontwikkelen. Met deze oplossing willen wij de handel in CO2-credits toegankelijker, betrouwbaarder en transparanter maken, waardoor bedrijven en particulieren op een verantwoorde en duurzame manier kunnen bijdragen aan de strijd tegen klimaatverandering.</p>\r\n\";}',0,''),(111,70,NULL,'50yinmyix4','block-0',0,'<p>Onze visie gaat verder dan alleen het aanbieden van een betrouwbare handelsoplossing voor CO2-credits. Wij streven ernaar om het bewustzijn rondom klimaatverandering en de noodzaak van verduurzaming te vergroten. Door middel van samenwerkingen, educatie en het delen van onze kennis, willen wij anderen inspireren om actie te ondernemen en bij te dragen aan een groenere toekomst.</p>\r\n\r\n<p>Bij ons bedrijf geloven we in de kracht van technologie en innovatie om de wereld te veranderen. Onze passie voor duurzaamheid en onze toewijding aan het bestrijden van klimaatverandering drijft ons voortdurend om de grenzen te verleggen en nieuwe manieren te ontdekken om een positieve impact te maken op onze planeet.</p>\r\n\r\n<p>Wij zijn toegewijd aan het bouwen van een betere toekomst voor ons allemaal en nodigen u uit om deel uit te maken van onze missie. Sluit u aan bij ons in de strijd tegen klimaatverandering en laten we samenwerken aan een groenere, duurzamere wereld.</p>\r\n','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:2:\"12\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(112,71,NULL,'66w49jj3r2','block-0',0,NULL,'[]',NULL,NULL,NULL,NULL,'a:10:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:2:\"12\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";s:4:\"text\";s:82:\"<p>Neutral is de oplossing voor betrouwbare en transparante CO2-certificaten</p>\r\n\";s:7:\"subtext\";s:59:\"<p>Wij vertellen je graag meer over de mogelijkheden.</p>\r\n\";s:7:\"buttons\";a:1:{s:10:\"ut0sqopn0l\";a:4:{s:5:\"label\";s:15:\"Neem contact op\";s:3:\"url\";s:7:\"page:20\";s:5:\"class\";s:0:\"\";s:6:\"target\";s:0:\"\";}}}',0,''),(113,72,NULL,'ugjkfsbr0a','block-0',0,'<h3><img alt=\"\" src=\"/uploads/images/20220826/5527_bullhorn.png\" style=\"width: 80px; height: 80px;\" /></h3>\r\n\r\n<h3>Aangedreven door blockchain</h3>\r\n\r\n<p> </p>\r\n','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"3\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(114,72,NULL,'uaqbsl8s4e','block-0',1,'<h3><img alt=\"\" src=\"/uploads/images/20220826/5385_network.png\" style=\"width: 80px; height: 80px;\" /></h3>\r\n\r\n<h3>Deelbare CO2-certificaten</h3>\r\n\r\n<p> </p>\r\n','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\";s:5:\"style\";s:0:\"\";s:4:\"link\";s:0:\"\";s:6:\"target\";s:0:\"\";s:5:\"width\";s:1:\"3\";s:6:\"offset\";s:0:\"\";s:2:\"id\";s:0:\"\";}',0,''),(115,72,NULL,'uedr22wuxe','block-0',2,'<h3><img alt=\"\" src=\"/uploads/images/20220826/6275_settings.png\" style=\"width: 80px; height: 80px;\" /></h3>\r\n\r\n<h3>Betrouwbaar en transparant</h3>\r\n\r\n<p> </p>\r\n','[]',NULL,NULL,NULL,'text','a:7:{s:5:\"class\";s:0:\"\