deren en komt de opgeslagen koolstof vrij in de atmosfeer. Door het waterpeil te verhogen, kan de oxidatie worden verminderd en kan het veen behouden blijven als een effectieve CO2-opslag. Er zijn echter ook uitdagingen en beperkingen verbonden aan deze aanpak, zoals mogelijke overstromingen en de noodzaak van andere maatregelen om de CO2-opslag te optimaliseren. Niettemin kan deze aanpak bijdragen aan het behoud van de biodiversiteit en kan het worden geïmplementeerd zonder de noodzaak van grote infrastructuurprojecten of ingrijpende veranderingen in het landschap.</p>','<p>Het verhogen van het grondwaterpeil in veenweidegebieden kan een effectieve manier zijn om CO2-opslag te bevorderen. Het veen in deze gebieden fungeert als een koolstofopslag, maar wanneer het waterpeil daalt, kan het veen gaan oxideren en komt de opgeslagen koolstof vrij in de atmosfeer. Door het waterpeil te verhogen, kan de oxidatie worden verminderd en kan het veen behouden blijven als een effectieve CO2-opslag.</p>\r\n\r\n<p>Een van de belangrijkste voordelen van deze aanpak is dat het relatief eenvoudig is. Door simpelweg het waterpeil te verhogen, kan de oxidatie van het veen worden verminderd en kan de CO2-opslag worden bevorderd. Bovendien kan dit worden gedaan zonder de noodzaak van grote infrastructuurprojecten of ingrijpende veranderingen in het landschap. Een ander voordeel van deze aanpak is dat het kan bijdragen aan het behoud van de biodiversiteit. Door het waterpeil te verhogen, kan de vegetatie in veenweidegebieden worden behouden en kunnen dieren die afhankelijk zijn van deze vegetatie worden beschermd. Dit kan leiden tot een verhoging van de biodiversiteit en kan bijdragen aan het behoud van een gezond ecosysteem.</p>\r\n\r\n<p>Kortom, het verhogen van het grondwaterpeil in veenweidegebieden kan een effectieve manier zijn om CO2-opslag te bevorderen en bij te dragen aan het behoud van een gezond ecosysteem. Het is echter belangrijk om zorgvuldig de lokale omstandigheden te evalueren voordat deze aanpak wordt geïmplementeerd en om andere maatregelen te nemen indien nodig om de CO2-opslag te optimaliseren.</p>','',1,769,'2023-02-15 00:00:00','2023-07-27 00:00:00','Leeuwarden',NULL,4,10000,70.0000,NULL,'a:0:{}',770,771,'-voorbeeld-grondwaterpeil-verhoging','a:1:{i:0;i:1;}',1,772,NULL,4575612,4575613,'Op weg naar een duurzame toekomst voor Veenweiden','','https://explorer.arkhia.io/#/testnet/account/0.0.3042696',0),(42,38,'[Voorbeeld] Duurzame isolatiematerialen','<p>Planten zorgen voor gezonde lucht in onze huizen. Maar wist u dat ze ons ook warm houden? Bouwgroep Dijkstra Draisma isoleert woningen met de bekende \'sigarenplant\' lisdodde. Wij vinden het heel belangrijk om bij te dragen aan een duurzame toekomst. Daarom zien we met lisdodde als bouwmateriaal een mooie kans. Een kans voor de energietransitie, omdat het ons helpt energie te besparen in woningen. Maar ook een kans voor de circulaire economie, omdat het een duurzaam lokaal bouwmateriaal is. Door het materiaal lokaal te verbouwen en te gebruiken stimuleren we de lokale circulaire economie. Samen met onze partners gaan we uitdagingen op het gebied van energie, klimaat en de circulaire economie aan.</p>','<p>In de zoektocht naar duurzame oplossingen voor de bouwsector, worden steeds meer alternatieven onderzocht en ontwikkeld. Een van deze alternatieven is bouwen met bio-based materialen, waarbij natuurlijke materialen worden gebruikt in plaats van traditionele bouwmaterialen. Een van de meest veelbelovende materialen is lisdodde.&nbsp;Lisdodde is een waterplant die groeit in moerassen en wetlands. Het is een snelgroeiende plant die tot wel 3 meter hoog kan worden en jaarlijks tot wel 20 ton biomassa per hectare kan produceren. Dit maakt lisdodde een zeer duurzame grondstof voor de bouwsector.</p>\r\n\r\n<p>Een van de voordelen van lisdodde is dat het een zeer goede CO2-opslag heeft. Tijdens de groei neemt de plant CO2 op uit de atmosfeer en slaat deze op in de biomassa. Door lisdodde te gebruiken als bouwmateriaal wordt deze opgeslagen CO2 vastgehouden en wordt de uitstoot van CO2 door de bouwsector verminderd.&nbsp;Lisdodde kan op verschillende manieren worden verwerkt tot bouwmateriaal. Zo kan het worden gebruikt als isolatiemateriaal, bijvoorbeeld als isolatieplaten voor daken, vloeren en muren. Ook kan het worden verwerkt tot plaatmateriaal, zoals spaanplaat, dat kan worden gebruikt voor meubels en interieurafwerking. Daarnaast kan het worden gebruikt als bouwblokken en kan het worden toegepast in gevelbekleding.</p>\r\n\r\n<p>Een ander voordeel van lisdodde als bouwmateriaal is dat het zeer brandwerend is. Dit komt doordat het materiaal van nature weinig zuurstof bevat, waardoor het niet snel ontvlambaar is. Dit maakt het materiaal zeer geschikt voor toepassingen in de bouw.&nbsp;Bouwen met lisdodde heeft nog meer voordelen. Zo is het een zeer hernieuwbare grondstof, die jaarlijks kan worden geoogst zonder dat de plantenpopulatie wordt aangetast. Ook heeft het materiaal een relatief lage milieu-impact tijdens de productie, omdat er geen fossiele brandstoffen worden gebruikt.&nbsp;Het gebruik van bio-based materialen zoals lisdodde in de bouwsector heeft nog een lange weg te gaan voordat het op grote schaal wordt toegepast. Toch zijn de vooruitzichten veelbelovend. Het materiaal is duurzaam, hernieuwbaar, CO2-opslag en brandwerend, waardoor het een zeer aantrekkelijke optie is voor de bouwsector. Bovendien draagt het bij aan het verminderen van de uitstoot van broeikasgassen en de overgang naar een duurzame, circulaire economie.</p>','',2,773,'2023-02-09 00:00:00','2023-06-08 00:00:00','Leeuwarden',NULL,4,100000,85.0000,NULL,'a:5:{i:0;i:777;i:1;i:778;i:2;i:779;i:3;i:780;i:4;i:781;}',774,775,'-voorbeeld-duurzame-isolatiematerialen','a:1:{i:0;i:1;}',1,776,NULL,4575670,4575671,'Biobased bouwen met lisdodde','','https://explorer.arkhia.io/#/testnet/account/0.0.3042696',0);
